import React from "react";
import "./style.css";

function A3 () {
    return (
        <div id="a3">
            <div>
                <h4>Become a registered user.</h4>
                <p className="small">Enhance our library.</p>
            </div>
            <img src="https://truffle-shuffle.s3.us-east-2.amazonaws.com/Assets/img/Quercus_nigra_acorns_01jpg.jpg" alt="acorns"/>

        </div>
    );
}

export default A3;
